int ContactModel::rowCount(const QModelIndex &) const
{
    return m_contacts.count();
}

QVariant ContactModel::data(const QModelIndex &index, int role) const
{
    if (index.row() < rowCount())
        switch (role) {
        case FullNameRole: return m_contacts.at(index.row()).fullName;
        case AddressRole: return m_contacts.at(index.row()).address;
        case CityRole: return m_contacts.at(index.row()).city;
        case NumberRole: return m_contacts.at(index.row()).number;
        case WorkPhoneRole: return m_contacts.at(index.row()).workPhone;
        case HomePhoneRole: return m_contacts.at(index.row()).homePhone;
        case EmailRole: return m_contacts.at(index.row()).email;
        case BirthDateRole: return m_contacts.at(index.row()).birthDate;
        case PhotoRole: return m_contacts.at(index.row()).photo;
        default: return QVariant();
        }
    return QVariant();
}

QHash<int, QByteArray> ContactModel::roleNames() const
{
    static const QHash<int, QByteArray> roles {
        { FullNameRole, "fullName" },
        { AddressRole, "address" },
        { CityRole, "city" },
        { NumberRole, "number" },
        { WorkPhoneRole, "workPhone" },
        { HomePhoneRole, "homePhone" },
        { EmailRole, "email" },
        { BirthDateRole, "birthDate" },
        { PhotoRole, "photo" }
    };
    return roles;
}

QVariantMap ContactModel::get(int row) const
{
    const Contact contact = m_contacts.value(row);
    return {
        {"fullName", contact.fullName},
        {"address", contact.address},
        {"city", contact.city},
        {"number", contact.number},
        {"workPhone", contact.workPhone},
        {"homePhone", contact.homePhone},
        {"email", contact.email},
        {"birthDate", contact.birthDate},
        { "photo", contact.photo }

    };
}

void ContactModel::append(const QString &fullName, const QString &address, const QString &city,
                          const QString &number, const QString &workPhone, const QString &homePhone,
                          const QString &email, const QString &birthDate, const QString &photo)
{
    int row = 0;
    while (row < m_contacts.count() && fullName > m_contacts.at(row).fullName)
        ++row;
    beginInsertRows(QModelIndex(), row, row);
    m_contacts.insert(row, {fullName, address, city, number, workPhone, homePhone, email, birthDate, photo});
    endInsertRows();
    saveContacts();
}

void ContactModel::set(int row, const QString &fullName, const QString &address, const QString &city,
                       const QString &number, const QString &workPhone, const QString &homePhone,
                       const QString &email, const QString &birthDate, const QString &photo)
{
    if (row < 0 || row >= m_contacts.count())
        return;

    m_contacts.replace(row, { fullName, address, city, number, workPhone, homePhone, email, birthDate, photo  });
    dataChanged(index(row, 0), index(row, 0), { FullNameRole, AddressRole, CityRole, NumberRole,
                                               WorkPhoneRole, HomePhoneRole, EmailRole, BirthDateRole, PhotoRole  });
    saveContacts();
}

void ContactModel::remove(int row)
{
    if (row < 0 || row >= m_contacts.count())
        return;

    beginRemoveRows(QModelIndex(), row, row);
    m_contacts.removeAt(row);
    endRemoveRows();
    saveContacts();
}

void ContactModel::saveContacts() {
    QSettings settings;
    settings.beginWriteArray("contacts");
    for (int i = 0; i < m_contacts.size(); ++i) {
        settings.setArrayIndex(i);
        settings.setValue("fullName", m_contacts[i].fullName);
        settings.setValue("address", m_contacts[i].address);
        settings.setValue("city", m_contacts[i].city);
        settings.setValue("number", m_contacts[i].number);
        settings.setValue("workPhone", m_contacts[i].workPhone);
        settings.setValue("homePhone", m_contacts[i].homePhone);
        settings.setValue("email", m_contacts[i].email);
        settings.setValue("birthDate", m_contacts[i].birthDate);
        settings.setValue("photo", m_contacts[i].photo);
    }
    settings.endArray();
}

void ContactModel::loadContacts() {
    qDebug() << "Файл контактов:" << QSettings().fileName();
    QSettings settings;
    int size = settings.beginReadArray("contacts");

    beginResetModel();
    m_contacts.clear();

    for (int i = 0; i < size; ++i) {
        settings.setArrayIndex(i);
        Contact contact;
        contact.fullName = settings.value("fullName").toString();
        contact.address = settings.value("address").toString();
        contact.city = settings.value("city").toString();
        contact.number = settings.value("number").toString();
        contact.workPhone = settings.value("workPhone").toString();
        contact.homePhone = settings.value("homePhone").toString();
        contact.email = settings.value("email").toString();
        contact.birthDate = settings.value("birthDate").toString();
        contact.photo = settings.value("photo").toString();

        m_contacts.append(contact);
    }

    settings.endArray();
    endResetModel();
}
